import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Home from './pages/Home';

const App = () => {
  return (
    <div>
      <BrowserRouter>
      <Switch>
        <Route path="/" component={Home}/>
      </Switch>

      </BrowserRouter>
    </div>
  );
};

export default App;
